import React, { useState } from 'react';

// Import all lab components with correct filenames
import GroceryList from './GroceryList';                    // Lab 1
import Car from './Car';                                    // Lab 2
import Phone from './Phone';                                // Lab 3
import SweetsList from './SweetsList';                      // Lab 4
import Electronics from './Electronics';                    // Lab 5
import CanteenMenu from './CanteenMenu';                    // Lab 6
import JuiceList from './JuiceList';                        // Lab 7
import Restaurant from './Restaurant';                      // Lab 8
import TempleList from './TempleList';                      // Lab 9
import TailorShop from './TailorShop';                      // Lab 10
import FruitsLab11 from './FruitsLab11';                    // Lab 11
import TelevisionLab12 from './TelevisionLab12';            // Lab 12

import MarriageForm from './MarriageForm';                  // Lab 13 (Make sure file named MarriageForm.js)
import AccessoriesForm from './AccessoriesForm';            // Lab 14 (Make sure file named AccessoriesForm.js)

import { FlightBookingControlled, FlightBookingUncontrolled } from './FlightBookingLab15'; // Lab 15 (Make sure file named FlightBookingLab15.js)

function App() {
  const [lab, setLab] = useState('');

  // Sample data for GroceryList
  const groceries = ['Rice', 'Wheat', 'Sugar', 'Milk', 'Oil'];

  return (
    <div className="container mt-4">
      <h1 className="text-center mb-4">React Labs Project</h1>

      <div className="d-flex flex-wrap gap-2 mb-4">
        <button className="btn btn-outline-primary" onClick={() => setLab('lab1')}>Lab 1 - GroceryList</button>
        <button className="btn btn-outline-primary" onClick={() => setLab('lab2')}>Lab 2 - Car</button>
        <button className="btn btn-outline-primary" onClick={() => setLab('lab3')}>Lab 3 - Phone</button>
        <button className="btn btn-outline-primary" onClick={() => setLab('lab4')}>Lab 4 - SweetsList</button>
        <button className="btn btn-outline-primary" onClick={() => setLab('lab5')}>Lab 5 - Electronics</button>
        <button className="btn btn-outline-primary" onClick={() => setLab('lab6')}>Lab 6 - CanteenMenu</button>
        <button className="btn btn-outline-primary" onClick={() => setLab('lab7')}>Lab 7 - JuiceList</button>
        <button className="btn btn-outline-primary" onClick={() => setLab('lab8')}>Lab 8 - Restaurant</button>
        <button className="btn btn-outline-primary" onClick={() => setLab('lab9')}>Lab 9 - TempleList</button>
        <button className="btn btn-outline-primary" onClick={() => setLab('lab10')}>Lab 10 - TailorShop</button>
        <button className="btn btn-outline-primary" onClick={() => setLab('lab11')}>Lab 11 - FruitsList</button>
        <button className="btn btn-outline-primary" onClick={() => setLab('lab12')}>Lab 12 - Television</button>
        <button className="btn btn-outline-primary" onClick={() => setLab('lab13')}>Lab 13 - MarriageForm</button>
        <button className="btn btn-outline-primary" onClick={() => setLab('lab14')}>Lab 14 - AccessoriesForm</button>
        <button className="btn btn-outline-primary" onClick={() => setLab('lab15')}>Lab 15 - FlightBooking</button>
      </div>

      {lab === 'lab1' && <GroceryList items={groceries} />}
      {lab === 'lab2' && <Car brand="Toyota" model="Fortuner" color="Black" year="2022" />}
      {lab === 'lab3' && <Phone />}
      {lab === 'lab4' && <SweetsList />}
      {lab === 'lab5' && <Electronics />}
      {lab === 'lab6' && <CanteenMenu />}
      {lab === 'lab7' && <JuiceList />}
      {lab === 'lab8' && <Restaurant />}
      {lab === 'lab9' && <TempleList />}
      {lab === 'lab10' && <TailorShop />}
      {lab === 'lab11' && <FruitsLab11 />}
      {lab === 'lab12' && <TelevisionLab12 />}
      {lab === 'lab13' && <MarriageForm />}
      {lab === 'lab14' && <AccessoriesForm />}
      {lab === 'lab15' && (
        <>
          <FlightBookingControlled />
          <FlightBookingUncontrolled />
        </>
      )}
    </div>
  );
}

export default App;
